import React, { useState, useEffect } from "react";
import axios from "axios";


const Report = () => {
  const [company, setCompany] = useState("");
  const [department, setDepartment] = useState("");
  const [mainCategory, setMainCategory] = useState("");
  const [type, setType] = useState("");
  const [companies, setCompanies] = useState([]);
  const [departments, setDepartments] = useState([]);
  const [types, setTypes] = useState([]);
  const [filteredAssets, setFilteredAssets] = useState([]);

  // Fetch Companies & Departments on Load
  useEffect(() => {
    fetchFilters();
  }, []);

  const fetchFilters = async () => {
    try {
      const response = await axios.get("http://localhost:8000/api/AssetRegisterDetails/getFilterOptions");
      setCompanies(response.data.companies);
      setDepartments(response.data.departments);
    } catch (error) {
      console.error("Error fetching filter options:", error);
    }
  };

  // Fetch Electronic Items Only
  const fetchElectronicItems = async () => {
    try {
      if (mainCategory === "Electronic items") {
        const response = await axios.get(
          `http://localhost:8000/api/AssetRegisterDetails/getElectronicItems`
        );
        setFilteredAssets(response.data);
        
        // Extract unique types from response
        const uniqueTypes = [...new Set(response.data.map((item) => item.type))];
        setTypes(uniqueTypes);
      } else {
        setFilteredAssets([]);
        setTypes([]);
      }
    } catch (error) {
      console.error("Error fetching electronic items:", error);
    }
  };

  // Fetch Data when mainCategory changes
  useEffect(() => {
    fetchElectronicItems();
  }, [mainCategory]);

  return (
    <div>
      {/* Filters Section */}
      <div className="filters">
        <select value={company} onChange={(e) => setCompany(e.target.value)}>
          <option value="">Select Company</option>
          {companies.map((com, index) => (
            <option key={index} value={com}>
              {com}
            </option>
          ))}
        </select>

        <select value={department} onChange={(e) => setDepartment(e.target.value)}>
          <option value="">Select Department</option>
          {departments.map((dep, index) => (
            <option key={index} value={dep}>
              {dep}
            </option>
          ))}
        </select>

        <select value={mainCategory} onChange={(e) => setMainCategory(e.target.value)}>
          <option value="">Select Category</option>
          <option value="Electronic items">Electronic items</option>
        </select>

        {mainCategory === "Electronic items" && (
          <select value={type} onChange={(e) => setType(e.target.value)}>
            <option value="">Select Type</option>
            {types.map((t, index) => (
              <option key={index} value={t}>
                {t}
              </option>
            ))}
          </select>
        )}
      </div>

      {/* Display Filtered Electronic Items */}
      {filteredAssets.length > 0 ? (
        <table className="asset-table">
          <thead>
            <tr>
              <th>Company</th>
              <th>Department</th>
              <th>Type</th>
              <th>Asset Name</th>
              <th>Serial Number</th>
            </tr>
          </thead>
          <tbody>
            {filteredAssets.map((asset, index) => (
              <tr key={index}>
                <td>{asset.company}</td>
                <td>{asset.department}</td>
                <td>{asset.type}</td>
                <td>{asset.assetName}</td>
                <td>{asset.serialNumber}</td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No electronic items found.</p>
      )}
    </div>
  );
};

export default Report;
